/*Table structure for table `usuario` */

DROP TABLE IF EXISTS `usuario`;

CREATE TABLE `usuario` (
  `numero_documento` bigint(14) unsigned NOT NULL,
  `clave` varchar(40) COLLATE utf8_bin DEFAULT NULL,
  `rol` tinyint(1) unsigned NOT NULL,
  `activo` tinyint(1) DEFAULT NULL,
  `fecha_creacion` datetime DEFAULT NULL,
  KEY `FK_usuario_numero_documento` (`numero_documento`),
  CONSTRAINT `FK_usuario_numero_documento` FOREIGN KEY (`numero_documento`) REFERENCES `persona` (`numero_documento`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

