/* Procedure structure for procedure `SP_AlterPersona` */

/*!50003 DROP PROCEDURE IF EXISTS  `SP_AlterPersona` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_AlterPersona`(
			IN _opcion INT,
			IN _numero_documento INT,
			IN _nombre TEXT,
			IN _direccion TEXT,
			IN _barrio TEXT,
			IN _telefono INT,
			in _correo_electronico TEXT
			)
BEGIN
	CASE _opcion
	    WHEN '1' THEN 
		INSERT INTO persona(numero_documento,nombre,direccion,barrio,telefono,correo_electronico,fecha_creacion)
			VALUES(_numero_documento,_nombre,_direccion,_barrio,_telefono,_correo_electronico,now());
		SELECT _numero_documento;
	    WHEN '2' THEN 
		UPDATE persona SET
			nombre = _nombre,
			direccion = _direccion,
			barrio = _barrio,
			telefono = _telefono,
			correo_electronico = _correo_electronico
		WHERE numero_documento = _numero_documento;
		SELECT _numero_documento;
	    ELSE
		SELECT '0';
	END CASE;
    END */$$
DELIMITER ;

/*Table structure for table `view_usuarios_claves` */

DROP TABLE IF EXISTS `view_usuarios_claves`;

/*!50001 DROP VIEW IF EXISTS `view_usuarios_claves` */;
/*!50001 DROP TABLE IF EXISTS `view_usuarios_claves` */;

/*!50001 CREATE TABLE  `view_usuarios_claves`(
 `correo` text ,
 `clave` varchar(40) ,
 `rol` varchar(11) ,
 `nombre` text 
)*/;

/*View structure for view view_usuarios_claves */

/*!50001 DROP TABLE IF EXISTS `view_usuarios_claves` */;
/*!50001 DROP VIEW IF EXISTS `view_usuarios_claves` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `view_usuarios_claves` AS (select `p`.`correo` AS `correo`,`u`.`clave` AS `clave`,(case `u`.`rol` when 1 then 'estudiante' when 2 then 'coordinador' end) AS `rol`,`p`.`nombre` AS `nombre` from (`persona` `p` join `usuario` `u` on((`p`.`numero_documento` = `u`.`numero_documento`)))) */;

